import { makeStyles } from '@material-ui/core/styles';

export const useStyles = makeStyles({
  card: {
    maxWidth: 224
  },
  media: {
    height: 224,
    width: 224
  },
  container: {
    justifyContent: 'center',
    display: 'grid',
    margin: 20
  }
});
